import React, { Component } from "react";

const card = { height: "300px", width: "80%", backgroundColor: "pink" };
class Titles extends Component {
  render() {
    return (
      <div>
        <div className={card}>{this.props.data.title}</div>
      </div>
    );
  }
}

export default Titles;
